import React from "react";
import "../../styles/rack-node.css";

function RackNode({data}){
    return(
        <div className={`rack-node rack-${data.status}`}>
            <div className="rack-title">{data.name}</div>
            <div className="rack-current">
                {data.current} A
            </div>
        </div>
    )
}
export default RackNode;
